import mixin from 'blockchain-ui-privatization/PC/common-mixin/modules/coTrade/tradingView/tradingView';
import 'blockchain-ui-privatization/PC/common-mixin/modules/coTrade/tradingView/tradingView.styl';
import Echarts from "../echarts/index.vue";
export default {
  mixins: [mixin],
  components: {
    Echarts: Echarts
  },
  mounted: function mounted() {
    this.init();
  },
  destroyed: function destroyed() {
    this.$bus.$off('SYMBOL_LIST_ALL'); // 监听 WebSocket 链接成功

    this.$bus.$off('WEBSOCKET_ON_OPEN'); // 获取 当前选中的货币对

    this.$bus.$off('SYMBOL_CURRENT');
  },
  beforeDestroy: function beforeDestroy() {
    this.MywebSocket = false;
  }
};
